import java.util.ArrayList;
import java.util.HashMap;
import java.util.List;
import java.util.Map;

public class FindAnagrams {
    public List<Integer> findAnagrams(String s, String p) {
        List<Integer> res = new ArrayList<Integer>();
        if (s.length() < p.length()){
            return res;
        }
        Map<Character, Integer> sCharCount = new HashMap<Character, Integer>();
        Map<Character, Integer> pCharCount = new HashMap<Character, Integer>();
        int l = 0, r = p.length() - 1;
        for (int i = 0;i < p.length(); i ++){
            pCharCount.put(p.charAt(i), pCharCount.getOrDefault(p.charAt(i), 0) + 1);
            sCharCount.put(s.charAt(i), sCharCount.getOrDefault(s.charAt(i), 0) + 1);
        }
        while(r < s.length()){
            if (isAnagram(pCharCount, sCharCount)){
                res.add(l);
            }
            r++;
            if (r < s.length()){
                sCharCount.put(s.charAt(r), sCharCount.getOrDefault(s.charAt(r), 0) + 1);
            }
            sCharCount.put(s.charAt(l), sCharCount.get(s.charAt(l)) - 1);
            l++;
        }
        return res;
    }

    private boolean isAnagram(Map<Character, Integer> a, Map<Character, Integer> b){
        for (Character c: a.keySet()){
            System.out.println(b.get(c));
            System.out.println(a.get(c));
            if (b.containsKey(c) && b.get(c).intValue() == a.get(c).intValue()){
                continue;
            }
            return false;
        }
        return true;
    }

    public static void main(String[] args) {
        FindAnagrams findAnagrams = new FindAnagrams();
        String s = "";
        String p = "";
        findAnagrams.findAnagrams(s,p); //[0,1,2]
    }
}
